AHORE, May 5 (APP): Member National Assembly Barjees Tahir called on Prime Minister Shehbaz Sharif here on Thursday and discussed current political situation in the country.
During the meeting, MNA Barjees Tahir congratulated the prime minister on his successful visits to Saudi Arabia and the United Arab Emirates.
